import{_ as t,o as d,c as a,Q as e}from"./chunks/framework.2c915ec2.js";const u=JSON.parse('{"title":"如何理解 HTTP 状态码？","description":"","frontmatter":{"title":"如何理解 HTTP 状态码？","date":"2018-09-20T13:00:28.000Z","sidebar":"auto","tags":["http","状态码"],"categories":["网络协议"]},"headers":[],"relativePath":"network-protocol/09.http状态码.md","lastUpdated":1702473622000}'),r={name:"network-protocol/09.http状态码.md"},o=e('<p>RFC 标准把状态码分成了五类</p><ul><li>1××：提示信息，表示目前是协议处理的中间状态，还需要后续的操作；</li><li>2××：成功，报文已经收到并被正确处理；</li><li>3××：重定向，资源位置发生变动，需要客户端重新发送请求；</li><li>4××：客户端错误，请求报文有误，服务器无法处理；</li><li>5××：服务器错误，服务器在处理请求时内部发生了错误。</li></ul><h2 id="_1××" tabindex="-1">1×× <a class="header-anchor" href="#_1××" aria-label="Permalink to &quot;1××&quot;">​</a></h2><p>1×× 类状态码属于提示信息，是协议处理的中间状态，实际能够用到的时候很少。</p><p><strong>101 Switching Protocols</strong>。在 <code>HTTP</code> 升级为 <code>WebSocket</code> 的时候，如果服务器同意变更，就会发送状态码 101。</p><h2 id="_2××" tabindex="-1">2×× <a class="header-anchor" href="#_2××" aria-label="Permalink to &quot;2××&quot;">​</a></h2><table><thead><tr><th>状态码</th><th>描述</th></tr></thead><tbody><tr><td>200 OK</td><td>是最常见的成功状态码，通常在响应体中放有数据。</td></tr><tr><td>204 No Content</td><td>表示成功，但是响应体中没有 body 数据。</td></tr><tr><td>206 Partial Content</td><td>表示部分内容，它的使用场景为 HTTP 分块下载和断电续传，当然也会带上相应的响应头字段 <code>Content-Range</code>。</td></tr></tbody></table><h2 id="_3××" tabindex="-1">3×× <a class="header-anchor" href="#_3××" aria-label="Permalink to &quot;3××&quot;">​</a></h2><table><thead><tr><th>状态码</th><th>描述</th></tr></thead><tbody><tr><td>301</td><td>永久重定向</td></tr><tr><td>302</td><td>临时重定向，不会做缓存优化</td></tr><tr><td>304</td><td>协商缓存</td></tr></tbody></table><h2 id="_4xx" tabindex="-1">4xx <a class="header-anchor" href="#_4xx" aria-label="Permalink to &quot;4xx&quot;">​</a></h2><table><thead><tr><th>状态码</th><th>描述</th></tr></thead><tbody><tr><td>400</td><td>笼统的错误码</td></tr><tr><td>401</td><td>用户没有访问权限</td></tr><tr><td>403</td><td>Forbidden 表示服务器禁止访问资源</td></tr><tr><td>404</td><td>资源在本服务器上未找到</td></tr><tr><td>405</td><td>请求方法不被服务器端允许</td></tr><tr><td>409</td><td>多个请求发生了冲突</td></tr><tr><td>413</td><td>请求体的数据过大</td></tr></tbody></table><h2 id="_5××" tabindex="-1">5×× <a class="header-anchor" href="#_5××" aria-label="Permalink to &quot;5××&quot;">​</a></h2><table><thead><tr><th>状态码</th><th>描述</th></tr></thead><tbody><tr><td>500</td><td>笼统的错误码</td></tr><tr><td>501</td><td>表示客户端请求的功能还不支持</td></tr><tr><td>502</td><td>服务器自身是正常的，但访问的时候出错了，啥错误咱也不知道</td></tr><tr><td>503</td><td>表示服务器当前很忙，暂时无法响应服务</td></tr></tbody></table>',13),h=[o];function l(i,n,_,c,s,b){return d(),a("div",null,h)}const x=t(r,[["render",l]]);export{u as __pageData,x as default};
